    const {Result,loading,error }= resultdata;
    console.log(Result);

    useEffect(()=>{
       dispatch( getResultByExamId(exam_id))
    },[])
  return (
    <>
        {loading && <Loader/>}
        {error && <Error/>}

    </>
  )
}

export default Results
